import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import { ReactDOM } from 'react';

export class UserCourses extends Component {
  static displayName = UserCourses.name;

  constructor(props) {
    super(props);
  }



  

  render() {
    //TODO delete hardcode:
    var courses = ['1', '2', '3'];

    function renderTableBody() {     
      for (let element of courses) {
        ReactDOM.render(
        <tr>
          <td>01.01.2000</td>
          <td>Get fit</td>
          <td>Dieting, excercise and other important things</td>
          <td>Chodakowska</td>
        </tr>
        );
      }
    }

    return (    
      <div>
        <div className="d-flex justify-content-between mb-3">
          <h1>Your courses:</h1>  
          <Link className="btn btn-primary m-2" to="/all-courses">See all our courses</Link>
                    
        </div>
        <table class="table table-hover">
          <thead>
          
            <tr>
              <th scope="col">Date & time</th>
              <th scope="col">Course</th>
              <th scope="col">Description</th>
              <th scope="col">Teacher</th>
            </tr>
          </thead>
          <tbody>            
          { this.renderTableBody() }
          </tbody>
        </table>

      </div>
    
    );
  }
}
